import styled from "styled-components";

export const MainContainer = styled.div`
display: flex;
justify-content: center;
align-items: center;
width: 100%;
height: 100%;
`;

export const SubMainContainer = styled.div`
width: 95%;
background-color: #f7f7f7;
`;
